import {DOMAIN} from '../url'
import {useDispatch, useSelector} from 'react-redux'
import { useEffect } from 'react'
import { getProducts } from '../slice'

function Body() {
  const dispatch = useDispatch()

  useEffect(() => {
     dispatch(getProducts({page: 10}))
  },[])

  const productState = useSelector(state => state.slice.product)
  console.log(productState);

  const map = productState.map(ev => (
    <div key={ev._id}>
      <p>{ev.author}</p>
    </div>
  ))

  return(
    <div>

     {map}

      <a id='g-10' href={`/${DOMAIN}/?page=1`}>1</a>
      <a href={`/${DOMAIN}/?page=2`}>2</a>
    </div>
  )
}
export default Body
